🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷

👉 Prestem atenção no relatório pessoal! 

👉 Em nenhum lugar está escrito que não houve fraude;

👉 FA pediu com urgência a criação de uma comissão com renomados técnicos para apuração;

👉 FA afirmou que não teve acesso a todos os dados e isso compromete diretamente as investigações e a lisura do processo eleitoral;

👉 Houve inúmeros questionamentos ao código-fonte das urnas.

📢📢📢📢📢📢📢📢📢📢📢📢📢📢

👉 Quem garante o nosso direito de manifestação é a Constituição Federal, não o TSE;

👉 A única exigência constitucional para o direito de manifestação é o aviso prévio às autoridades competentes e o próprio STF entende que basta a veiculação da informação para cumprir o requisito;

👉 o Ministro Mendonça do STF afirmou que as manifestações pacíficas devem ser respeitadas.

🚨🚨🚨🚨🚨🚨🚨🚨🚨🚨🚨🚨🚨🚨

👉 Estamos lutando contra a corrupção;

👉 Buscamos eleições limpas;

👉 Vamos apoiar as FA nesse momento crucial da democracia e pedir a criação da comissão para apurar a eleição de 2022 e a abertura do código-fonte da urna;

👉 Vamos fazer as maiores e mais belas manifestações pacíficas que o nosso país já teve. Vamos mostrar que a democracia vai vencer a mentira jogando nas 4 linhas da constituição.

👉 Não é hora de desanimar, vamos pra cima meu BRASIL!!!

